scriptlet.script:
var temp = scriptletInput.replace(/\/*$/, "");
if (temp.indexOf("http://") == 0)
	temp = temp.substring(7, temp.length);
var index = temp.lastIndexOf("/");
if (index > -1 && (index+1 == temp.length || temp.substring(index, temp.length).indexOf(".") >-1)){
    scriptletResult = temp.substring(0, index);
}
else
	scriptletResult= temp;

try{
failedURLs = scriptletContext.get("failedURLs");
if (failedURLs != null)
{
var urls = failedURLs.split(";");
if (urls!=null || urls!="")
{
var finalString="";
for (var i=1; i<urls.length; i++)
{
    if (finalString == "")
    {
        finalString = urls[i];
    }else{
         finalString = finalString + ";" + urls[i];
    }
 }

scriptletContext.put("failedURLs", finalString);
}
}
}catch(e)
{
}

